import React from 'react';
import {Menu, Icon} from 'semantic-ui-react';

const Widgets = () => {
	return (
		<div className="ui center aligned grid" style={{ marginTop: '0.2em' }}>
			<div className="ui horizontal list">
				<Menu.Item href="mailto: aanthonyhem@gmail.com">
					 <Icon name="envelope outline" />
				</Menu.Item>
				<Menu.Item href="https://www.instagram.com/anthony.hem/">
					 <Icon name="instagram" />
				</Menu.Item>
				<Menu.Item href="https://www.youtube.com/channel/UCHvG_DEGdQdR4CvEO0xLEuA">
					 <Icon name="youtube" />
				</Menu.Item>
				<Menu.Item href="../data/resume.pdf">
					 Resume
				</Menu.Item>
			</div>
		</div>
	);
}

export default Widgets;
